function EraTable({ selectedDim }) {
  const dim = selectedDim || "D";
  const data = ERA_PCTS[dim];
  const tStyle = {borderCollapse:"collapse",width:"100%",fontSize:"10px",fontFamily:"'JetBrains Mono',monospace"};
  const thS = {textAlign:"right",padding:"4px 5px",color:"#a09580",fontWeight:400,fontSize:"9px"};
  const tdS = {textAlign:"right",padding:"3px 5px",color:"#d4c9a8"};
  // Color: compare each era's value to the first era (01-05) for delta coloring
  const deltaColor = (pk, era) => {
    if (era === "01-05") return "#d4c9a8";
    const base = data["01-05"][pk];
    const cur = data[era][pk];
    if (base === null || cur === null || base === 0) return "#d4c9a8";
    const pct = ((cur - base) / Math.abs(base)) * 100;
    if (pct > 5) return "#8aab6e";
    if (pct < -5) return "#c44e52";
    return "#d4c9a8";
  };
  return (
    <div style={{overflowX:"auto"}}>
      <table style={tStyle}>
        <thead>
          <tr style={{borderBottom:"1px solid #3d3829"}}>
            <th style={{...thS,textAlign:"left"}}>Era</th>
            {PCT_KEYS.map(pk => (
              <th key={pk} style={thS}>{PCT_LABELS[pk]}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {ERA_KEYS.map(era => (
            <tr key={era} style={{borderBottom:"1px solid #1f1c15"}}>
              <td style={{padding:"3px 5px",color:"#a09580",fontWeight:600,fontSize:"10px"}}>'{era}</td>
              {PCT_KEYS.map(pk => (
                <td key={pk} style={{...tdS,color:deltaColor(pk,era)}}>
                  {data[era][pk] !== null ? data[era][pk].toFixed(3) : ""}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

